import React, { Component } from 'react'
import { Table } from 'react-bootstrap'
import './Patients.css'

export class Patients extends Component {
    constructor (props) {
        super(props)

    }

    headers() {
        return this.state.columns.map(col => {
            <th>{ col }</th>
        });
    }

    renderPatient (patient, index) {
        return (
            <tr key={index}>
                <td>{ patient.FirstName }</td>
                <td>{ patient.LastName }</td>
                <td>{ patient.NPI }</td>
                <td>{ patient.PhoneNumber }</td>
                <td>
                    { patient.Address.Line1 } <br />
                    { patient.Address.Line2 } <br />
                    { patient.Address.City } <br />
                    { patient.Address.State } <br />
                    { patient.Address.ZipCode }
                </td>
            </tr>
        )
    }

    render() {
        return (
        <Table striped bordered hover size='sm' className='patients-tbl'>
            <thead>
                <tr>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>NPI #</th>
                    <th>Phone Number</th>
                    <th>Business Address</th>
                </tr>
            </thead>
            <tbody>
                { this.props.users.map(this.renderPatient)}
            </tbody>
        </Table>
        )
  }
}

export default Patients
